import { Fragment } from "react";
import mealImage from "../../assests/food.jpeg";

const Header = props => {

    return <Fragment>
           <header>
            <h1>Food Katta</h1>
            <button>Order Cart</button>
           </header>
           <div>
            <img src={mealImage} />
           </div>
    </Fragment>
};
export default Header;
